<html>
  <head>
    <script src="https://unpkg.com/rxjs@^7/dist/bundles/rxjs.umd.min.js"></script>
  </head>
  <body>
    <script>
      const {
        range,
        filter,
        map,
        from,
        groupBy,
        count,
        mergeMap,
        merge,
        toArray,
        reduce,
        of,
        delay,
        concatMap,
        interval,
        observeOn,
        asyncScheduler,
        queueScheduler,
        zip,
        bufferTime,
        Subject,
        Observable,
        retry,
        throwError,
      } = rxjs;

      const obj1 = { name: "airmanx", age: 10, height: 200 };
      const obj2 = { x: "airmanx", y: 10, z: 200 };

      of(obj1, obj2)
        .pipe(concatMap((b) => from(Object.keys(b))))
        .subscribe((x) => {
          console.log(x);
        });

      of(1, 2, 3).subscribe((c) => {
        console.log(c);
      });

      console.log("complete");
    </script>
  </body>
</html>
